// @mui material components
import Grid from "@mui/material/Grid";
// import Icon from "@mui/material/Icon";

// Soft UI Dashboard PRO React components
import SuiBox from "components/SuiBox";
import SuiTypography from "components/SuiTypography";

// Soft UI Dashboard PRO React example components
import DashboardLayout from "examples/LayoutContainers/DashboardLayout";
import DashboardNavbar from "examples/Navbars/DashboardNavbar";
import Footer from "examples/Footer";
import MiniStatisticsCard from "examples/Cards/StatisticsCards/MiniStatisticsCard";

import breakpoints from "assets/theme/base/breakpoints";



function Default() {
    const { values } = breakpoints;


    return (
        <DashboardLayout>
            <DashboardNavbar />
            <SuiBox py={1}>
                <Grid container>
                    <Grid item xs={12} lg={12}>
                        <SuiBox mb={3} p={1}>
                            <SuiTypography
                                variant={window.innerWidth < values.sm ? "h3" : "h2"}
                                textTransform="capitalize"
                                fontWeight="bold"
                                textAlign="center"
                                style={{ color: 'green' }}
                            >
                                MONTHLY DASHBOARD
                            </SuiTypography>
                        </SuiBox>
                        <h3 style={{ color: 'red' }}>May</h3>
                        <hr style={{ color: 'brown' }} />
                        <Grid container spacing={2}>
                            <Grid item xs={12} sm={3}>
                                <SuiBox mb={4}>
                                    <MiniStatisticsCard
                                        title={{ text: "Total Investment" }}
                                        count="Rs.53,000"
                                        percentage={{ color: "success", text: "" }}
                                        icon={{ color: "", component: "" }}
                                    // backgroundColor="#1798A5;"
                                    />
                                </SuiBox>
                                <MiniStatisticsCard
                                    title={{ text: "Valuation" }}
                                    count="Rs. 2,300"
                                    percentage={{ color: "success", text: "" }}
                                    icon={{ color: "", component: "" }}
                                // backgroundColor="#ffccff;"
                                />
                            </Grid>
                            <Grid item xs={12} sm={3}>
                                <SuiBox mb={3}>
                                    <MiniStatisticsCard
                                        title={{ text: "Total Investment" }}
                                        count="Rs.53,000"
                                        percentage={{ color: "success", text: "" }}
                                        icon={{ color: "", component: "" }}
                                    // backgroundColor="#abebc6;"
                                    />
                                </SuiBox>
                                <MiniStatisticsCard
                                    title={{ text: "Valuation" }}
                                    count="Rs. 2,300"
                                    percentage={{ color: "success", text: "" }}
                                    icon={{ color: "", component: "" }}
                                // backgroundColor="#e6f3ff;"
                                />
                            </Grid>
                            <Grid item xs={12} sm={3}>
                                <SuiBox mb={3}>
                                    <MiniStatisticsCard
                                        title={{ text: "Total Div Paid" }}
                                        count="Rs.3,462"
                                        percentage={{ color: "error", text: "" }}
                                        icon={{ color: "", component: "" }}
                                    // backgroundColor="#ffccff;"
                                    />
                                </SuiBox>
                                <SuiBox mb={3}>
                                    <MiniStatisticsCard
                                        title={{ text: "Total Div Rein." }}
                                        count="Rs.103,430"
                                        percentage={{ color: "success", text: "" }}
                                        icon={{
                                            color: "",
                                            component: "",
                                        }}
                                    // backgroundColor="#1798A5;"
                                    />
                                </SuiBox>
                            </Grid>
                            <Grid item xs={12} sm={3}>
                                <SuiBox mb={3}>
                                    <MiniStatisticsCard
                                        title={{ text: "Total gain/Loss" }}
                                        count="3,462"
                                        percentage={{ color: "error", text: "" }}
                                        icon={{ color: "", component: "" }}
                                    // backgroundColor="#e6f3ff;"
                                    />
                                </SuiBox>
                                <SuiBox mb={3}>
                                    <MiniStatisticsCard
                                        title={{ text: "Abs Rtn./CAGR" }}
                                        count="37.25%/18.22"
                                        percentage={{ color: "success", text: "" }}
                                        icon={{
                                            color: "",
                                            component: "",
                                        }}
                                    // backgroundColor="#ffccff;"
                                    />
                                </SuiBox>
                            </Grid>
                        </Grid>

                    </Grid>
                </Grid>
            </SuiBox>
            <Footer />
        </DashboardLayout>
    );
}

export default Default;
